  return (
    <div className="flex flex-col w-60 p-3 bg-white">
      <div className="pr-10">
        <img src={logo} alt="logo" />
      </div>
      <div className="flex-1">
        {DASHBOARD_SIDEBAR_LINKS.map((item) => (
          <div key={item.key}>{item.label}</div>
        ))}
      </div>

      <div>bottompart</div>
    </div>
  );
